Big Butts Like It Big - Sophie Dee - The Ass That Tails!

March 28, 2011

Sophie is beyond obsessed with one man in particular. She compulsively stalks him. She's borderline psycho and will go to no ends in following him. When she finds he's moving to another state, she decides to stow away in his moving truck. The movers find her hidden in the back of the truck, so they call him up, he tells the movers to bring her back to where she came from, and make sure she doesn't know where he is.
